/*
LRU Cache
Design and implement a data structure for Least Recently Used (LRU) cache. It should support the following operations: get and set.

get(key) - Get the value (will always be positive) of the key if the key exists in the cache, otherwise return -1.
set(key, value) - Set or insert the value if the key is not already present. When the cache reached its capacity, it should invalidate the least recently used item before inserting a new item.
*/

/*
Feb 10 2014
What is LRU?
Refer to:
http://mcicpc.cs.atu.edu/archives/2012/mcpc2012/lru/lru.html

Solution:
- Linked list for priority, each access puts the element in the front of list.
- Time limit exceeds for data structure only with linked list, need hashmap for quicker access
Reference:
http://blog.csdn.net/doc_sgl/article/details/15378513
Note:
When using linked list, better to have a non-data head and tail, it is better for insertion and deletion.
*/

#include <iostream>
#include <map>
using namespace std;

class CacheNode
{
public:
    int key;
    CacheNode *next;
    CacheNode *prev;
    CacheNode(int k, int v)
    {
        key = k;
        value = v;
        next = NULL;
        prev = NULL;
    }
    void set (int v)
    {
        value = v;
    }
    int get ()
    {
        return value;
    }
private:
    int value;
};

class LRUCache{
public:
    CacheNode *head;
    CacheNode *tail;
    LRUCache(int capacity) {
        cap = capacity;
        head = new CacheNode(-500,-500);
        tail = new CacheNode(-1000,-1000);
        head->prev = NULL;
        head->next = tail;
        tail->prev = head;
        tail->next = NULL;
        cnt = 0;
        table.clear();
    }

    int get(int key) {
        //cout<<"in get "<<key<<endl;
        CacheNode *cur = NULL;
        if (table.count(key))
        {
            cur = table[key];
            // move node to front
            cur->prev->next = cur->next;
            cur->next->prev = cur->prev;
            cur->next = head->next;
            head->next->prev = cur;
            cur->prev = head;
            head->next = cur;
            return cur->get();
        }
        return -1;
    }

    void set(int key, int value) {
        //cout<<"in set "<<key<<","<<value<<endl;
        CacheNode *cur = head;
        if (table.count(key))
        {
            cur = table[key];
            // move node to front
            cur->prev->next = cur->next;
            cur->next->prev = cur->prev;
            cur->next = head->next;
            head->next->prev = cur;
            cur->prev = head;
            head->next = cur;
            cur->set(value);
            return;
        }
        // cannot find the key, delete last if full
        //cout<<"delete last"<<endl;
        if (cnt == cap)
        {
            cur = tail->prev;
            if (cur != head)
            {
                cur->prev->next = cur->next;
                cur->next->prev = cur->prev;
                table.erase(cur->key);
                delete cur;
                cnt--;
            }
        }
        // insert at front
        //cout<<"insert new"<<endl;
        cur = new CacheNode(key, value);
        table[key] = cur;
        cur->next = head->next;
        head->next->prev = cur;
        cur->prev = head;
        head->next = cur;
        cnt++;
    }
private:
    int cap;
    int cnt;
    map<int, CacheNode*> table;
};


